import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Holdings.css';

const Holdings = () => {
  const [holdings, setHoldings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchHoldings = async () => {
      try {
        setLoading(true);
        const response = await axios.get('http://localhost:8000/api/portfolio/current');
        setHoldings(response.data.holdings || []);
        setError(null);
      } catch (err) {
        setError('Failed to fetch holdings data');
        console.error('Error fetching holdings:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchHoldings();
  }, []);

  if (loading) {
    return (
      <div className="holdings-container">
        <div className="loading">Loading holdings...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="holdings-container">
        <div className="error">{error}</div>
      </div>
    );
  }

  return (
    <div className="holdings-container">
      <h2>Current Holdings</h2>
      <div className="holdings-table-container">
        <table className="holdings-table">
          <thead>
            <tr>
              <th>Symbol</th>
              <th>Name</th>
              <th>Quantity</th>
              <th>Avg Price</th>
              <th>Current Price</th>
              <th>Market Value (£)</th>
              <th>P&L (£)</th>
              <th>Return (%)</th>
              <th>Currency</th>
              <th>Sector</th>
              <th>Country</th>
            </tr>
          </thead>
          <tbody>
            {holdings.map((holding, index) => (
              <tr key={index} className={holding.return_pct >= 0 ? 'positive' : 'negative'}>
                <td className="symbol">{holding.t212_code}</td>
                <td className="name">{holding.name}</td>
                <td className="quantity">{holding.quantity.toLocaleString()}</td>
                <td className="price">£{holding.avg_price.toFixed(2)}</td>
                <td className="price">£{holding.current_price.toFixed(2)}</td>
                <td className="value">£{holding.market_value.toLocaleString(undefined, { minimumFractionDigits: 2, maximumFractionDigits: 2 })}</td>
                <td className={`pnl ${holding.ppl + holding.fx_ppl >= 0 ? 'positive' : 'negative'}`}>
                  £{(holding.ppl + holding.fx_ppl).toLocaleString(undefined, { minimumFractionDigits: 2, maximumFractionDigits: 2 })}
                </td>
                <td className={`return ${holding.return_pct >= 0 ? 'positive' : 'negative'}`}>
                  {holding.return_pct >= 0 ? '+' : ''}{holding.return_pct.toFixed(2)}%
                </td>
                <td className="currency">{holding.currency}</td>
                <td className="sector">{holding.sector || 'N/A'}</td>
                <td className="country">{holding.country || 'N/A'}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div className="holdings-summary">
        <p>Total Holdings: {holdings.length}</p>
        <p>Last Updated: {holdings.length > 0 ? new Date(holdings[0].date).toLocaleDateString() : 'N/A'}</p>
      </div>
    </div>
  );
};

export default Holdings;
